# Что делает эта программа?
# осуществляет фильтрацию всех A36/A66
# и формирует B36/B66
# работает она с файлом main_6_output.json, его описание есть в программе main_6.py
# все B36/B66 формируются в файл следующей структуры:
# у нас есть словарь, где ключи - ncbi ID
# а значения 1 отрезок B36 и 10 отрезков B66 (отрезков геномов)
# пример:
# {
# <ncbi_id>: [
#               <B36_1>,
#               <B66_2>,
#               <B66_3>,
#               <B66_4>,
#               <B66_5>,
#               <B66_6>,
#               <B66_7>,
#               <B66_8>,
#               <B66_9>,
#               <B66_10>,
#               <B66_11>,
#           ]
# }

import json

# лимит на кол-во несовпадений
B66_miss_limit = 13
B36_miss_limit = 7

# референсный геном NCBI Reference Sequence: NC_045512.2
ref_seq = ''

# разметка CS-отрезков (начало CS-ов) референсного генома
markup = [
    69,
    21555,
    25384,
    26236,
    26472,
    27040,
    27387,
    27743,
    27887,
    28259,
    29496
]

# референсные A66
ref_A66 = [

]

A66_MARGIN = 30

for i in range(len(markup)):
    cs_start = markup[i]

    if i == 0:
        ref_A66.append(ref_seq[cs_start:cs_start+6+A66_MARGIN])
    else:
        ref_A66.append(ref_seq[cs_start-A66_MARGIN:cs_start+6+A66_MARGIN])

# читаем выходной файл main_6.py
with open("main_6_output.json") as jsonFile:
   all_A66 = json.load(jsonFile)

# кол-во несовпадающих символов
def diff(seq1, seq2):
    miss = 0
    for i in range(len(seq1)):
        if seq1[i] != seq2[i]:
            miss += 1
    return miss

# последовательность не содержит плохих символов (которые не A, C, T, G)
def no_bad_symbols(seq):
    return 'N' not in seq and 'Y' not in seq and 'K' not in seq and 'M' not in seq and 'R' not in seq and 'S' not in seq and 'W' not in seq and 'D' not in seq

# выходной файл этой программы
B66 = {}

# кол-во A66
A66_count = 0
# кол-во B66
B66_count = 0

for i in all_A66:
    # проверим каждый из A16/A26

    is_B66 = True

    for j in range(len(all_A66[i])):
        if j == 0:
            ref_B36 = ref_A66[0]
            cur_B36 = all_A66[i][j]
            if diff(ref_B36, cur_B36) > B36_miss_limit or no_bad_symbols(cur_B36) == False:
                is_B66 = False
        else:
            ref_B66 = ref_A66[j]
            cur_B66 = all_A66[i][j]
            if diff(ref_B66, cur_B66) > B66_miss_limit or no_bad_symbols(cur_B66) == False:
                is_B66 = False

    if is_B66:
        B66[i] = all_A66[i]
        B66_count += 1

    A66_count += 1

with open('main_6_2_output.json', 'w') as f:
    f.write(json.dumps(B66))

print("Всего A66:", A66_count)
print("Всего B66:", B66_count)

